draw(graph(func,0.5,2.5));
draw((-0.5,0)--(2.5,0));
draw((0,-1)--(0,1));
draw(Circle(A,abs(A - (1,0))));
draw(O--T);

label("$t$", T/3, N);

dot(T);
[/asy]
